import React from 'react';
import { Link } from 'react-router-dom';

const CaseStudies = () => {
  return (
    <section className="py-20 px-6">
      <h2 className="text-4xl font-serif text-red-600 mb-6">Case Studies</h2>
      
      {/* Display the 3 sub-cards for Case Studies, Product Teardowns, and PRDs */}
      <div className="grid grid-cols-3 gap-6">
        
        {/* Case Studies Sub-Card */}
        <Link to="/product-teardowns" className="border border-red-600 p-4 rounded-lg hover:shadow-lg bg-black">
          <h4 className="text-xl font-serif text-red-600">Case Studies</h4>
        </Link>

        {/* Product Teardowns Sub-Card */}
        <Link to="/product-teardowns" className="border border-red-600 p-4 rounded-lg hover:shadow-lg bg-black">
          <h4 className="text-xl font-serif text-red-600">Product Teardowns</h4>
        </Link>

        {/* Product Required Documents Sub-Card */}
        <Link to="/prds" className="border border-red-600 p-4 rounded-lg hover:shadow-lg bg-black">
          <h4 className="text-xl font-serif text-red-600">Product Required Documents</h4>
        </Link>
      </div>
    </section>
  );
};

export default CaseStudies;
